import React, { useState } from "react";
import { Routes, Route } from "react-router-dom"
import "./HomePage.css";
import Sidenav from "./Sidenav";

export default function HomePage() {

    return (
        <div className="HomePage">
            <Sidenav/>
            <main>
                <Routes>
                    <Route path="/" />
                    <Route path="/explore"  />
                    <Route path="/statistics" />
                    <Route path="/settings" />
                </Routes>
            </main>
        </div>
    );
}
